import React, { Component } from 'react';
import styled from 'styled-components';

const Header = styled.header`
    display: flex;
    justify-content: space-between;
    padding-left: 24px;
    padding-right: 24px;
`;


class Header__container extends Component {
    render() {
        return (
            <Header>
                <div>
                    <div>
                        <a href="#">
                            <img scr={require('../img/logo.jpg')} alt="Print on balls"></img>
                        </a>
                    </div>
                    <div>
                        <Button backgroundColor="blue" text="Sign in" />
                    </div>
                </div>
            </Header>
        )
    }


}

export default Header__container;
